import React from 'react';
import './css/documents_checking.css'

function DocumentsChecking() {
  return (
    <div className="App">

        {/* Conteneur pour le logo et le bouton retour */}
        <div className="header-container">

            {/* Rectangle 'go back rectangle' */}
            <div className="rectangle back-button">
                <p style={{ fontSize: '2.5em' }}>Retour</p>
            </div>

            {/* logo container */}
            <div className="logo_container">
                {/* logo PharmaXcess */}
                <img
                    src={require('./../../assets/logo.png')}
                    alt="Logo PharmaXcess"
                    className="logo"
                />
            </div>

        </div>

        <div className='body_page'>

            {/* Rectangle 'main rectangle' */}
            <div className="rectangle" style={{top: '20%', left: '50%'}}>
                <p style={{ fontSize: '3em' }}>
                    Veuillez insérer vos documents
                </p>
            </div>

            {/* Rectangle 'document 1' */}
            {/* <div className="rectangle" style={{top: '60%', left: '50%'}}>
                <p style={{ fontSize: '3em' }}>
                    Insérer document 1
                </p>
            </div> */}

        </div>

    </div>
  );
}

export default DocumentsChecking;
